// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./interfaces/IVerifier.sol";

contract Proposal {
    struct VoteInfo {
        uint256 forVotes;
        uint256 againstVotes;
        uint256 endTime;
        bool isFinalized;
    }

    string public title;
    string public description;
    address public immutable verifier;
    VoteInfo public voteInfo;
    mapping(bytes32 => bool) public nullifierHashes;

    event VoteCast(bytes32 nullifierHash, bytes32 voteHash);
    event ProposalFinalized(uint256 forVotes, uint256 againstVotes);

    constructor(
        string memory _title,
        string memory _description,
        address _verifier,
        uint256 _votingPeriod
    ) {
        title = _title;
        description = _description;
        verifier = _verifier;
        voteInfo.endTime = block.timestamp + _votingPeriod;
    }

    function castVote(
        uint256[2] memory a,
        uint256[2][2] memory b,
        uint256[2] memory c,
        bytes32 voteHash,
        bytes32 nullifierHash
    ) external {
        require(block.timestamp < voteInfo.endTime, "Voting period has ended");
        require(!nullifierHashes[nullifierHash], "Vote already cast");
        
        // Verify the zero-knowledge proof
        bool isValid = IVerifier(verifier).verifyProof(a, b, c, [uint256(voteHash), uint256(nullifierHash)]);
        require(isValid, "Invalid proof");

        nullifierHashes[nullifierHash] = true;
        
        // Update vote counts based on the vote hash
        // In a real implementation, this would be more sophisticated
        if (uint256(voteHash) % 2 == 0) {
            voteInfo.forVotes++;
        } else {
            voteInfo.againstVotes++;
        }

        emit VoteCast(nullifierHash, voteHash);
    }

    function finalize() external {
        require(block.timestamp >= voteInfo.endTime, "Voting period not ended");
        require(!voteInfo.isFinalized, "Already finalized");

        voteInfo.isFinalized = true;
        emit ProposalFinalized(voteInfo.forVotes, voteInfo.againstVotes);
    }

    function getVoteInfo() external view returns (VoteInfo memory) {
        return voteInfo;
    }
}

