// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./Proposal.sol";
import "./interfaces/IVerifier.sol";

contract ProposalFactory {
    struct ProposalInfo {
        address proposalAddress;
        string title;
        uint256 timestamp;
        address creator;
    }

    address public immutable verifier;
    ProposalInfo[] public proposals;
    uint256 public constant VOTING_PERIOD = 7 days;

    event ProposalCreated(address indexed proposalAddress, string title, address indexed creator);

    constructor(address _verifier) {
        verifier = _verifier;
    }

    function createProposal(string memory title, string memory description) external returns (address) {
        Proposal newProposal = new Proposal(
            title,
            description,
            verifier,
            VOTING_PERIOD
        );

        proposals.push(ProposalInfo({
            proposalAddress: address(newProposal),
            title: title,
            timestamp: block.timestamp,
            creator: msg.sender
        }));

        emit ProposalCreated(address(newProposal), title, msg.sender);
        return address(newProposal);
    }

    function getProposals() external view returns (ProposalInfo[] memory) {
        return proposals;
    }

    function getProposalCount() external view returns (uint256) {
        return proposals.length;
    }
}

